const TodoList = [
  { id: 1, text: "content1", done: true },
  { id: 2, text: "content2", done: false },
  { id: 3, text: "content3", done: false },
];
function Todos() {
  return (
    <div>
      <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
      </ul>
      {[<li>1</li>, <li>2</li>, <li>3</li>]}
    </div>
  );
}

export default Todos;
